import React from 'react';
import '../css/Footer.css'; // Asegúrate de que la ruta sea correcta

const Footer = () => {
  return (
    <footer className="footer">
      <p>&copy; 2024 ConstrudomotiK - Todos los derechos reservados</p>
      <div className="social-links">
        <a href="https://facebook.com/ConstrudomotiK" target="_blank" rel="noopener noreferrer">Facebook</a>
        <a href="https://instagram.com/ConstrudomotiK" target="_blank" rel="noopener noreferrer">Instagram</a>
        <a href="https://linkedin.com/company/ConstrudomotiK" target="_blank" rel="noopener noreferrer">LinkedIn</a>
        <a href="https://twitter.com/ConstrudomotiK" target="_blank" rel="noopener noreferrer">Twitter</a>
      </div>
    </footer>
  );
};

export default Footer;
